import React from 'react';
import "./Foot.css"

function Foot() {
  return (
    <foot >
        <div className="footer-content">
            <p>&copy; {new Date().getFullYear()} Jemos. Все права защищены.</p>
            <button>Кнопка</button>
        </div>
    </foot>
  );
}

export default Foot;
